    /*

    This is a script library for default Project Kaiser Workflow Package. You can modify this 
    script as you wish but note that in this case you will have to apply future possible fixes 
    from Triniforce manually

    */
    
    public static String STATUS_INACTIVE_KEY = "Inactive";    
    public static String STATUS_EXECUTION_KEY = "Execution";
    public static String STATUS_COMPLETED_KEY = "Completed";
    public static String STATUS_APPROVAL_KEY = "Approval";
    public static String STATUS_UNCLEAR_KEY = "Unclear";
    public static String STATUS_ACCEPTANCE_KEY = "Acceptance";
    
    public static String[] statusesToChangeResponsible = {STATUS_APPROVAL_KEY,  STATUS_UNCLEAR_KEY};
    
    public static String[] statusesToChangeAssignee = {STATUS_EXECUTION_KEY};
    
    
    public static WFPBeforeTransitionResponse pk_beforeTransition(WFPBeforeTransitionContext tc){
        WFPBeforeTransitionResponse res = new WFPBeforeTransitionResponse();
        
        IGeneral gen = ApiStack.getInterface(IGeneral.class);
        
        //make sure that Responsible (follow-up) person is not null if target status is in (Approval, Unclear)
        {
            List changeResponsibleList = Arrays.asList(statusesToChangeResponsible);
            if(changeResponsibleList.contains(tc.getNewStatus().getKey())){
  
                /*
                    Read responsibleId from cache. To get available fields execute from Administration/Run Script:

                        meta.getFiletypeFields("FTIssue");
                        
                    To get list of all filetypes use:
                        
                        meta.getClassifier("FTFiletype");
                    
                */
                
                Object responsibleId = gen.getTableField(tc.getIssueId(), TFileWorkflow.class.getName(), TFileWorkflow.follow_up_id.getName());

                if(null == responsibleId){
                    Object creatorId = gen.getTableField(tc.getIssueId(), TFile.class.getName(), TFile.creator.getName());
                    res.getNewFieldValues().put(TFileWorkflow.follow_up_id.getName(), creatorId);
                }
            }
        }
        //make sure that Assignee is not null if target status is Execution
        {
            List changeAssigneeList = Arrays.asList(statusesToChangeAssignee);
            if(changeAssigneeList.contains(tc.getNewStatus().getKey())){
                
                Object assigneeId = gen.getTableField(tc.getIssueId(), TFileWorkflow.class.getName(), TFileWorkflow.assignee_id.getName());

                if(null == assigneeId){
                    Long currentUserId = ICurrentUser.Helper.getCurrentUserID();
                    if(! currentUserId.equals(ReservedKeys.SYSTEM.getKey())){
                        res.getNewFieldValues().put(TFileWorkflow.assignee_id.getName(), currentUserId);
                    }
                }
            }
        }
        return res;
    }

    public static String N10N_BASE_KEY = "com.projectkaiser.wfp.DefaultWFP.stringResources.n10n";
    public static String N10N_TITLE_KEY = N10N_BASE_KEY + ".title";
    public static String N10N_BODY_KEY = N10N_BASE_KEY + ".body";
    
    public static N10nMessage pk_n10n_buildMessage(Boolean isActorMessage, ExWFPNotification n, N10nRowProcessor rp, N10nUserInfo ui){
        
        N10nRowContext rc = rp.getRowContext();
        
        Object[] args = new Object[9];
        
        args[0] = rc.sp.getServerName();
        args[1] = rc.sp.getServerUrl();
        args[2] = n.getStatus().getLocalizedName();
        args[3] = rc.causeFile.name;
        args[4] = rc.causeFile.URL;
        args[5] = rc.author.name;
        args[6] = rc.author.email;
        args[7] = rc.updateComment != null? rc.updateComment: rc.causeFile.descr;
        args[8] = ui.name;
        
        String suffix = isActorMessage?".actor":".notActor";
        String titleKey = N10N_TITLE_KEY + suffix;        
        String bodyKey = N10N_BODY_KEY + suffix;


        String titleTemplate = rc.sbc.getString(IL10nFile.PACKAGE_QUALIFIED, titleKey, "title");
        String bodyTemplate = rc.sbc.getString(IL10nFile.PACKAGE_QUALIFIED, bodyKey, "body");
        
        N10nMessage m = new N10nMessage();
        m.setTitle(java.text.MessageFormat.format(titleTemplate, args));
        m.setBody(java.text.MessageFormat.format(bodyTemplate, args));
        m.setFrom(isActorMessage? rc.author.email: null);
        
        return m;
    }

